import React, { useState, useEffect } from 'react';
import { useSelector } from 'react-redux';
import Layout from '../components/main/layout';
import Hero from '../components/main/hero';
import GreenPost from '../components/main/greenpost';
//import MainSection from '../components/main/main';
//import Embajadores from '../components/main/embajador';
//      <Embajada />
import Embajada from '../components/main/embajada';
import Events from '../components/main/events';
import Post from '../components/layout/post';
import Title from '../components/main/title';
import { color, font } from '../layout/var';
import AOS from 'aos';

const Ale = () => {
  useEffect(()=> {
    AOS.init;
  },[])
  return(
    <div className="main">
      <Title word="La mas hermosa" />
      <div data-aos="fade-in" data-aos-delay="500" className="cont">
        <div className="image">

        </div>
        <div className="info">
          <h1>Alejandra <span>Rojas</span></h1>
          <p>La usuaria mas Hermosa de esta y de todas las redes sociales que puedan existir y mas importante que eso, la mujer mas hermosa del mundo en el coraz√≥n de felix tineo coo-creador de GreenLink</p>
        </div>
      </div>
      <style jsx>{`
        .cont{
          //display: flex;
          //flex-direction: column;
          height: 100vh;
        }
        .image{
          background: url(/static/alejandra.jpg)top center no-repeat;
          background-size: cover;
          width: 100%;
          height:70%;
        }
        .info{
          display: flex;
          flex-direction: column;
          align-items: center;
          padding: 0 .5rem;
        }
        .info h1{
          color: ${color.prim};
          font-weight: 900;
        }
        .info span{
          color: transparent;
          -webkit-text-stroke: 1px ${color.prim};
        }
        .info p{
          text-align: justify;
        }
      `}
      </style>
    </div>
  )
}

const Main = () => {
  const postVisible = useSelector(state => state.post.visible);
  return(
    <Layout>
      <Hero />
      <Embajada />
      <Events />
      <Ale />
      <GreenPost />
      { postVisible && <Post /> }
    </Layout>
  )
}

export default Main;
